import React from 'react'
import {pulp_fiction} from '../config'

export default function Principal() {
  return (
    <div>
        <h1>This is the Principal component</h1>
        <img src={pulp_fiction} style={'weight:100vw'} alt='pulp fiction'></img>
    </div>
  )
}
